Iz("common/result.effekt",'module result\n\nimport effekt\nimport option\nimport exception\n\n/// Represents the result of a potentially failing computation.\n/// It is the "reification" of the Exception[E] effect.\ntype Result[A, E] {\n  Error(exception: E, msg: String);\n  Success(a: A)\n}\n\n/// Represent ("reify") the result of a potentially failing computation.\ndef result[A, E] { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\ndef result[A, E](proxy: on[E]) { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\n\n/// Extracts the value of a result, if available\n/// Monadic "reflection"\ndef value[A, E](r: Result[A, E]): A / Exception[E] \x3d r match {\n  case Success(a) \x3d\x3e a\n  case Error(exc, msg) \x3d\x3e do raise(exc, msg)\n}\n\n/// Converts a result to an option forgetting the error details\ndef toOption[A, E](r: Result[A, E]): Option[A] \x3d r match {\n  case Success(a) \x3d\x3e Some(a)\n  case Error(exc, msg) \x3d\x3e None()\n}\n\ndef isError[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Error(_, _)) true else false\n\ndef isSuccess[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Success(_)) true else false');
